const UrlSorten = () => {
    return (
        <div class="container">
            <div><h1 className="page-title">URL Sorten</h1></div>
            <div class="form-row align-items-center">
                <div class="col-auto">
                    <input type="text" className="form-control mb-2" id="inlineFormInput" placeholder="Jane Doe" />
                    {/* <input type ="text" className="form-control" id="exampleFormControlInput1" placeholder="Shorten your link" /> */}
                </div>
                <div class="col-auto"><button className="btn btn-success">Sorten</button></div>
            </div>
        </div>
    )
}

export default UrlSorten
